import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { submitSurveyResponse } from '../utils/api';
import { calculatePersonality } from '../utils/personalityCalculator';
import './QuestionPage.css';

// Question data based on personality types
const QUESTIONS = [
  { id: 1, text: "I enjoy meeting new people and social gatherings", category: "E" },
  { id: 2, text: "I prefer working in a structured and organized way", category: "J" },
  { id: 3, text: "I focus more on practical and realistic information", category: "S" },
  { id: 4, text: "I make decisions based on logic and objective analysis", category: "T" },
  { id: 5, text: "I prefer to think before acting", category: "I" },
  { id: 6, text: "I adapt easily to new situations and changes", category: "P" },
  { id: 7, text: "I am energized by spending time with others", category: "E" },
  { id: 8, text: "I prefer following established rules and procedures", category: "J" },
  { id: 9, text: "I trust my intuition and look for patterns and meanings", category: "N" },
  { id: 10, text: "I consider how my decisions affect others emotionally", category: "F" },
];

function QuestionPage({ userId, onResponseCreated }) {
  const navigate = useNavigate();
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [answers, setAnswers] = useState({});
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  // Use mock userId if not provided (for standalone testing)
  const effectiveUserId = userId || 'mock-user-id';

  const handleAnswer = (value) => {
    setAnswers(prev => ({
      ...prev,
      [currentQuestion]: value
    }));
  };

  const handleNext = () => {
    if (currentQuestion < QUESTIONS.length - 1) {
      setCurrentQuestion(prev => prev + 1);
    }
  };

  const handlePrevious = () => {
    if (currentQuestion > 0) {
      setCurrentQuestion(prev => prev - 1);
    }
  };

  const handleSubmit = async () => {
    if (Object.keys(answers).length < QUESTIONS.length) {
      setError('Please answer all questions before submitting');
      return;
    }

    setLoading(true);
    try {
      const result = calculatePersonality(answers, QUESTIONS);
      const surveyData = {
        userId: effectiveUserId,
        answers: Object.fromEntries(
          Object.entries(answers).map(([idx, ans]) => [QUESTIONS[idx].id, ans])
        ),
        classification: result.type,
        score: result.scores
      };

      // Try to submit to backend, but don't fail if it's not running
      try {
        const response = await submitSurveyResponse(surveyData);
        onResponseCreated(response.responseId);
      } catch (apiError) {
        console.log('Backend not available, using local results');
        // Generate a mock response ID for local testing
        onResponseCreated('mock-response-id-' + Date.now());
      }

      navigate('/results', { state: { result, surveyData } });
    } catch (err) {
      setError(err.error || 'Failed to submit survey');
    } finally {
      setLoading(false);
    }
  };

  const question = QUESTIONS[currentQuestion];
  const progress = ((currentQuestion + 1) / QUESTIONS.length) * 100;

  return (
    <div className="question-page container">
      <h1>Personality Assessment</h1>

      <div className="progress-bar">
        <div className="progress-fill" style={{ width: `${progress}%` }}></div>
      </div>

      <p className="progress-text">Question {currentQuestion + 1} of {QUESTIONS.length}</p>

      <div className="question-container">
        <h2>{question.text}</h2>

        <div className="answer-options">
          <label className="option">
            <input
              type="radio"
              name="answer"
              value="strongly-disagree"
              checked={answers[currentQuestion] === 'strongly-disagree'}
              onChange={(e) => handleAnswer(e.target.value)}
            />
            <span>Strongly Disagree</span>
          </label>

          <label className="option">
            <input
              type="radio"
              name="answer"
              value="disagree"
              checked={answers[currentQuestion] === 'disagree'}
              onChange={(e) => handleAnswer(e.target.value)}
            />
            <span>Disagree</span>
          </label>

          <label className="option">
            <input
              type="radio"
              name="answer"
              value="neutral"
              checked={answers[currentQuestion] === 'neutral'}
              onChange={(e) => handleAnswer(e.target.value)}
            />
            <span>Neutral</span>
          </label>

          <label className="option">
            <input
              type="radio"
              name="answer"
              value="agree"
              checked={answers[currentQuestion] === 'agree'}
              onChange={(e) => handleAnswer(e.target.value)}
            />
            <span>Agree</span>
          </label>

          <label className="option">
            <input
              type="radio"
              name="answer"
              value="strongly-agree"
              checked={answers[currentQuestion] === 'strongly-agree'}
              onChange={(e) => handleAnswer(e.target.value)}
            />
            <span>Strongly Agree</span>
          </label>
        </div>
      </div>

      {error && <div className="error">{error}</div>}

      <div className="button-group">
        <button 
          onClick={handlePrevious} 
          disabled={currentQuestion === 0}
          className="secondary"
        >
          Previous
        </button>

        {currentQuestion === QUESTIONS.length - 1 ? (
          <button 
            onClick={handleSubmit} 
            disabled={loading}
            className="primary"
          >
            {loading ? 'Submitting...' : 'Submit Assessment'}
          </button>
        ) : (
          <button 
            onClick={handleNext}
            disabled={!answers[currentQuestion]}
            className="primary"
          >
            Next
          </button>
        )}
      </div>
    </div>
  );
}

export default QuestionPage;
